import React, { useState } from 'react';
import './PlayerReports.css';

const PlayerReports = () => {
  const [playerName, setPlayerName] = useState('');
  const [playerRole, setPlayerRole] = useState('');

  const handleGenerate = () => {
    // Handle the generation logic
    // You would typically make a backend request here with the player details
    console.log({ playerName, playerRole });
  };

  return (
    <div className="player-reports-container">
      <div className="form-container">
        <br/>
        <h2>Player Report Generator</h2>
        <div className="form-group">
          <label htmlFor="playerName">Player Name:</label>
          <input
            type="text"
            id="playerName"
            value={playerName}
            onChange={(e) => setPlayerName(e.target.value)}
          />
        </div>
        <div className="form-group">
          <label htmlFor="playerRole">Player Role:</label>
          <input
            type="text"
            id="playerRole"
            value={playerRole}
            onChange={(e) => setPlayerRole(e.target.value)}
          />
        </div>
        <button onClick={handleGenerate}>Generate Report</button>
      </div>
      <div className="report-display">
        {/* This is where the generated report would be displayed */}
      </div>
    </div>
  );
};

export default PlayerReports;
